import React from "react";
import styles from "./LogIn.module.css";
import { Link } from "react-router-dom";

const LogIn = () => {
  const onSubmitHandler = (event) => {
    event.preventDefault();
  };

  return (

    <div className={styles.background}>
      <p id="login">Login </p><br /> <p id="signin">Not a member yet? <u> Sign up  </u></p>
      <div className={styles.social_media}>
        <button id="Facebook"><a className={styles.social_med_link} >Log in with Facebook</a></button>
        <button id="Gmail"><a className={styles.social_med_link}>Log in with Gmail</a></button>
      </div>

      <form onSubmit={onSubmitHandler}>
        <div className={styles.container}>
          <input type="text" placeholder="Enter Username" name="username" required /><br />
          <input type="password" placeholder="Enter Password" name="password" required /><br />
          <button type="submit" className={styles.log_but}>Login</button> <br />
        </div>

      </form>
    </div>
  );
};

export default LogIn;
